# Function to tokenize the Java source code and check if valid for further processing
def tokenize_source_code(file_path):
    try:
        with open(file_path, 'r') as file:
            code = file.read()
        tokens = list(javalang.tokenizer.tokenize(code))
        token_list = [(token.__class__.__name__, token.value) for token in tokens]
        return token_list, True
    except Exception as e:
        print(f"Error tokenizing {file_path}: {e}")
        return [], False

# Function to select and categorize Java files
def select_java_files(directory):
    simple_files = []
    moderate_files = []
    all_files = []

    for root, dirs, files in os.walk(directory):
        for file in files:
            if file.endswith(".java"):
                file_path = os.path.join(root, file)
                tokens, valid = tokenize_source_code(file_path)
                if valid:
                    if len(tokens) < 500:  # Simple files with fewer tokens
                        simple_files.append(file_path)
                    elif 500 <= len(tokens) < 1500:  # Moderate complexity
                        moderate_files.append(file_path)

    # Select 10-12 simple and 3-4 moderately complex files
    selected_simple_files = simple_files[:12]
    selected_moderate_files = moderate_files[:4]
    print(f"Selected {len(selected_simple_files)} simple files and {len(selected_moderate_files)} moderate files.\n")

    return selected_simple_files, selected_moderate_files

# Process tokenization and filter files
def process_tokenization(directory):
    simple_files, moderate_files = select_java_files(directory)
    all_files = simple_files + moderate_files

    for idx, java_file in enumerate(all_files):
        print(f"\nTokenizing file {idx+1}: {java_file}")
        tokens, _ = tokenize_source_code(java_file)
        for token in tokens[:20]:  # Display the first 20 tokens for each file
            print(token)

