# Function to generate AST for a Java file
def generate_ast(file_path):
    try:
        with open(file_path, 'r') as file:
            code = file.read()
        tokens = javalang.tokenizer.tokenize(code)
        parser = javalang.parser.Parser(tokens)
        tree = parser.parse()
        return tree
    except Exception as e:
        print(f"Error generating AST for {file_path}: {e}")
        return None

# Function to visualize AST
def visualize_ast(ast, output_file):
    graph = pydot.Dot(graph_type='digraph')

    def add_nodes_edges(node, parent=None):
        label = node.__class__.__name__
        if hasattr(node, 'position') and node.position:
            label += f' ({node.position})'
        graph.add_node(pydot.Node(str(id(node)), label=label))
        if parent:
            graph.add_edge(pydot.Edge(str(id(parent)), str(id(node))))
        for child in node.children:
            if isinstance(child, list):
                for sub_child in child:
                    if isinstance(sub_child, javalang.ast.Node):
                        add_nodes_edges(sub_child, node)
            elif isinstance(child, javalang.ast.Node):
                add_nodes_edges(child, node)

    add_nodes_edges(ast)
    graph.write_png(output_file)
    display(Image(output_file))

# Process ASTs for the selected files and visualize them
def process_asts(directory):
    simple_files, moderate_files = select_java_files(directory)
    all_files = simple_files + moderate_files

    for idx, java_file in enumerate(all_files[:15]):  # Limit to 15 files for visualization
        print(f"Processing AST for {java_file}")
        ast = generate_ast(java_file)
        if ast:
            output_file = f"ast_{idx+1}.png"
            visualize_ast(ast, output_file)
        else:
            print(f"Skipping AST visualization for {java_file} due to errors.")

