import javalang
import networkx as nx
import matplotlib.pyplot as plt
from IPython.display import display, Image

# Function to generate CFG for a Java file
def generate_cfg(file_path):
    try:
        with open(file_path, 'r') as file:
            code = file.read()
        tokens = javalang.tokenizer.tokenize(code)
        parser = javalang.parser.Parser(tokens)
        tree = parser.parse()
    except Exception as e:
        print(f"Error parsing file {file_path}: {e}")
        return None

    cfg = nx.DiGraph()

    def add_cfg_edges(node, parent=None):
        """ Recursively build the CFG by adding edges between nodes representing control flow. """
        if not isinstance(node, javalang.ast.Node):
            return

        label = node.__class__.__name__
        if hasattr(node, 'position') and node.position:
            label += f" ({node.position})"
        current_node_id = str(id(node))
        cfg.add_node(current_node_id, label=label)

        # If there's a parent node, add an edge to show control flow
        if parent:
            parent_node_id = str(id(parent))
            cfg.add_edge(parent_node_id, current_node_id)

        # Recursively handle children (control flow paths)
        for child in node.children:
            if isinstance(child, list):
                for sub_child in child:
                    if isinstance(sub_child, javalang.ast.Node):
                        add_cfg_edges(sub_child, node)
            elif isinstance(child, javalang.ast.Node):
                add_cfg_edges(child, node)

    # Start building the CFG by processing the root node
    add_cfg_edges(tree)
    return cfg

# Function to visualize CFG using networkx and matplotlib
def visualize_cfg(cfg, output_file):
    pos = nx.spring_layout(cfg, k=2.0)  # Adjusted layout for better spacing
    labels = nx.get_node_attributes(cfg, 'label')

    plt.figure(figsize=(20, 20))
    nx.draw(cfg, pos, labels=labels, with_labels=True, node_size=3000,
            node_color='lightblue', font_size=10, font_weight='bold', arrows=True)

    plt.savefig(output_file, format='png')
    plt.close()
    display(Image(output_file))

# Function to process CFGs for selected Java files
def process_cfgs(directory):
    simple_files, moderate_files = select_java_files(directory)  # Assuming this function selects files based on complexity
    all_files = simple_files + moderate_files

    for idx, java_file in enumerate(all_files[:15]):  # Limiting to 15 files
        print(f"Processing CFG for {java_file}")
        cfg = generate_cfg(java_file)
        if cfg:
            output_file = f"cfg_{idx+1}.png"
            visualize_cfg(cfg, output_file)
        else:
            print(f"Skipping CFG visualization for {java_file} due to errors.")

# Process CFGs for the selected files
