import torch.nn.functional as F

# Function to pad embeddings to the maximum sequence length
def pad_embeddings(embeddings_list):
    # Find the maximum sequence length
    max_seq_len = max(embedding.size(1) for embedding in embeddings_list)

    # Pad all embeddings to the maximum sequence length
    padded_embeddings = []
    for embedding in embeddings_list:
        seq_len = embedding.size(1)
        if seq_len < max_seq_len:
            # Pad the embedding to match max_seq_len
            padding = (0, 0, 0, max_seq_len - seq_len)  # Padding (start_dim, end_dim) along the sequence length axis
            padded_embedding = F.pad(embedding, padding, mode='constant', value=0)
            padded_embeddings.append(padded_embedding)
        else:
            padded_embeddings.append(embedding)

    return padded_embeddings

# Function to aggregate embeddings (mean of all path embeddings)
def aggregate_embeddings(embeddings_list):
    padded_embeddings = pad_embeddings(embeddings_list)  # Pad the embeddings before stacking
    aggregated_embedding = torch.mean(torch.stack(padded_embeddings), dim=0)
    return aggregated_embedding

# Example function to aggregate vectors for traversal paths
def aggregate_vectors_for_traversal_paths(ast):
    root_leaf_paths = root_to_leaf_paths(ast)
    leaf_leaf_paths = leaf_to_leaf_paths(ast)

    # Generate embeddings for root-to-leaf paths
    root_leaf_embeddings = generate_embeddings_for_traversal_paths(root_leaf_paths)

    # Generate embeddings for leaf-to-leaf paths
    leaf_leaf_embeddings = generate_embeddings_for_traversal_paths(leaf_leaf_paths)

    # Aggregate all embeddings
    all_embeddings = root_leaf_embeddings + leaf_leaf_embeddings
    final_representation = aggregate_embeddings(all_embeddings)

    print(f"Aggregated Vector Shape: {final_representation.shape}")
    return final_representation

