# Root-to-leaf traversal for AST
def root_to_leaf_paths(node):
    paths = []
    def traverse(current_node, current_path):
        current_path.append(current_node.__class__.__name__)
        children = list(filter(lambda x: isinstance(x, javalang.ast.Node), current_node.children))
        if not children:
            paths.append(list(current_path))
        for child in children:
            traverse(child, current_path)
        current_path.pop()

    traverse(node, [])
    return paths

# Leaf-to-leaf traversal for AST
def leaf_to_leaf_paths(node):
    paths = []
    def traverse(current_node, current_path):
        current_path.append(current_node.__class__.__name__)
        children = list(filter(lambda x: isinstance(x, javalang.ast.Node), current_node.children))
        if not children:
            if len(current_path) > 1:
                for i in range(len(current_path) - 1):
                    paths.append(current_path[i:] + current_path[:i + 1])
        for child in children:
            traverse(child, current_path)
        current_path.pop()

    traverse(node, [])
    return paths

# Aggregating vectors (mean) for the traversal paths
def aggregate_embeddings(embeddings_list):
    aggregated_embedding = torch.mean(torch.stack(embeddings_list), dim=0)
    return aggregated_embedding

# Function to extract and aggregate vectors for AST traversal paths
def aggregate_vectors_for_traversal_paths(ast):
    tokenizer = RobertaTokenizer.from_pretrained("microsoft/codebert-base")
    model = RobertaModel.from_pretrained("microsoft/codebert-base")

    root_leaf_paths = root_to_leaf_paths(ast)
    leaf_leaf_paths = leaf_to_leaf_paths(ast)
    combined_paths = root_leaf_paths + leaf_leaf_paths

    embeddings_list = []
    for path in combined_paths:
        code_snippet = " ".join(path)  # Convert path to a string
        inputs = tokenizer(code_snippet, return_tensors="pt")
        with torch.no_grad():
            outputs = model(**inputs)
        embeddings = outputs.last_hidden_state.mean(dim=1)  # Mean pool over sequence length
        embeddings_list.append(embeddings)

    aggregated_embedding = aggregate_embeddings(embeddings_list)
    return aggregated_embedding

