def pad_code2vec_vectors(code2vec_vectors, target_dim=768):
    padded_vectors = []
    for vec in code2vec_vectors:
        padding = np.zeros(target_dim - len(vec))  # Calculate the padding needed
        padded_vector = np.concatenate([vec, padding])  # Add padding to the original vector
        padded_vectors.append(padded_vector)
    return np.array(padded_vectors)

